import React from "react";

const UserDashboard = () => {
  return (
    <div>
      <h2>User Profile</h2>
      <div>
        <div>
          <p>Username</p> kenneth
        </div>
        <div>
          <p>Email</p> ken@gmail.com
        </div>
        <div>
          <p>Password</p> password
        </div>
      </div>
    </div>
  );
};

export default UserDashboard;
